import './Expenses.css'
import ExportItem from './ExpenseItem';

function Expenses(props){
    const data={...props.expenses}
    return(
        <div className="expenses">
            <ExportItem
            day={data[0].date}
            title={data[0].title}
            amount={data[0].amount}>
            </ExportItem>
        </div>
    )
}

export default Expenses;
